def tet(p: int, duffy: bool = False) -> (array, array, array, array):
    a, b, g, w = (array(pt) for pt in cell(p))
    if duffy:
        return a, b, g, w
    else:
        eta = (1. - a) * b
        zeta = (1. - a) * (1. - b) * g
        return a, eta, zeta, w
